import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navigation from "./components/NavBar";
import Links from "./components/Link";
import { Navbar } from "reactstrap";

function App() {
  return (
    <div className="App">
      <Navigation />
      <div className="container">
        <div className="row">
          <div className="col-sm-12">
            <Links></Links>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
